/**
 * JDownloader2 EventScript - Resume all skipped links (reason:CAPTCHA) on Download Paused
 *
 *@summary 一時停止時にCAPTCHAスキップされたリンクを再開
 *
 *
 *@event
 * [Trigger] "Download Controller paused"
 *
 */

(function(){
    getAllDownloadLinks().forEach(function(l)
    {
        if (!l.isFinished() && l.isSkipped() && l.getSkippedReason() == "CAPTCHA")
            l.resume();
    });
})();

#!/usr/bin/python3

import sys
import os
from flask import Flask, render_template
import iio

iio_context = iio.Context()

pin = '0'
sample = 0

IIOPATH='/sys/bus/iio/devices/iio:device0/in_voltage'+pin+'_raw'

print('Hit ^C to stop')

f = open(IIOPATH, "r")

app = Flask(__name__)
@app.route("/")
@app.route("/<state>")
def sab(state="my_samples"):
    if state == "sample":
        my_uri = sys.argv[1] if len(sys.argv) >= 3 else "0.0.0.0:8081"
        my_samples = sys.argv[2] if len(sys.argv) >= 3 else 200

        print("Executing trigger_now attribute for trigger0");
        print("for uri: " + str(my_uri))
        print("for " + str(my_samples) + " samples\n");
        i = 0
        while i < int(my_samples):
            f.seek(0)
            x = float(f.read())/4096
            print('{}: {:.1f}%, {:.3f} V'.format(pin, 100*x, 1.8*x), end = '\r')
            i+=1
            os.system("iio_attr -u "+my_uri+" -d trigger0 trigger_now 1 \n")
            print("triggered "+str(i)+" times\n" )

        template_data = {
            "title"   : state,
            "Big_IIO" : sample,
        }
    return render_template("Saber.html", state=state)

if __name__=="__main__":
    app.run(host="0.0.0.0", port=8080, debug=True)

#!/usr/bin/python3

# Testing IIO SS
# Found this source, well partially parts, on wiki.analog.com

import sys
import os
from flask import Flask, render_template

app = Flask(__name__)
@app.route("/")
@app.route("/<state>")
def sab(state=None):
    if state == "my_samples":
        my_uri = sys.argv[1] if len(sys.argv) >= 3 else "192.168.7.2:8080"
        my_samples = sys.argv[2] if len(sys.argv) >= 3 else 200

        print("Executing trigger_now attribute for trigger0");
        print("for uri: " + str(my_uri))
        print("for " + str(my_samples) + " samples\n");
        i = 0
        while i < int(my_samples):
            i+=1
            os.system("iio_attr -u "+my_uri+" -d trigger0 trigger_now 1 \n")
            print("triggered "+str(i)+" times\n" )

    template_data = {
        "title" : state,
    }
    return render_template("Saber.html", message=state)

if __name__=="__main__":
    app.run(host="0.0.0.0", port=8080, debug=True)

